nformações, sob qualquer pretexto, salvo quando requisitadas pelos órgãos governamentais competentes e pelo Poder Judiciário.<\/p><p>13.1.6. Informar à <strong>CONTRATADA<\/strong> qualquer alteração de seus dados cadastrais, incluindo troca de Endereço Físico e Endereço Eletrônico, sob pena de em não o fazendo considerarem-se válidos todos os avisos e notificações enviados para os endereços informados e constantes do presente <strong>CONTRATO<\/strong>.<\/p><p>13.2. <strong>DA CONTRATADA:<\/strong><\/p><p>13.2.1. Prestar o serviço, objeto do presente <strong>CONTRATO<\/strong>, zelando pela eficiência e regular funcionamento do serviço;<\/p><p>13.2.2. Fornecer suporte técnico ao (à) <strong>CONTRATANTE<\/strong> consistente em informações relativas ao uso dos sistemas;<\/p><p>13.2.3. O suporte será prestado através do setor de atendimento ao cliente, no horário comercial, através do site www.olhonocarro.com.br<\/p><p>13.2.4. Informar ao (à) <strong>CONTRATANTE<\/strong>, com 3 (três) dias de antecedência, sobre as interrupções necessárias para ajustes técnicos ou manutenção que demandem de 6 (seis) horas de duração e que possam causar prejuízo à operacionalidade do acesso aos sistemas, salvo em caso de urgência, caso fortuito ou força maior.<\/p><p>13.2.5. Manter a “mídia” hospedada acessível durante 99,5% do SLA (acordo de nível de serviço).<\/p><p>13.2.6. Ressaltada a hipótese de ter laborado com culpa exclusiva, a <strong>CONTRATADA<\/strong> não assume responsabilidade por perdas e danos que se originem das informações prestadas.<\/p><p>14. <strong>RESCISÃO CONTRATUAL<\/strong><\/p><p>14.1. Para os clientes <strong>PÓS PAGO<\/strong> a solicitação de rescisão contratual deverá ser feita pelo (a) <strong>CONTRATANTE<\/strong> mediante aviso por e-mail (contato@olhonocarro.com.br) e após quitação de todos os débitos em aberto, conforme expresso pelo artigo 476 do Código Civil, para ser concluído o pedido de rescisão.<\/p><p>14.1.1. Para os clientes <strong>PÓS PA